INSERT INTO `target_users` (`id`, `twitter_id`, `user_name`, `screen_name`, `follow_num`, `follower_num`, `profile_text`, `profile_img`, `tweet_id`, `tweet_text`, `tweeted_at`, `url`, `created_at`, `updated_at`, `deleted_at`) VALUES(521, '1316713121919115264', '米国株占い師🔯 & 仮想通貨', 'Uranaishi8', 11, 1168, '投資市場の動向予測が生きがい。株式投資歴約20年、仮想通貨投資歴5年。投資とは畑違いの分野で起業した後、会社を売却。その後、その資金を投資へ本格投入。2020年にコロナであまりにも暇ができた為Twitterを開始。各国の友人経営者（投資家）達とチームを組み常に情報共有をしながら投資成績向上に繋げている。', 'https://pbs.twimg.com/profile_images/1316713495648301057/pxuVIjjf_normal.jpg', '1365506767904333826', '私は最近「投資家には休みや勉学に励む期間が必要」とよく言っているが、私にとっては今はまさにこの期間だ。決して鵜呑みにはしないで欲しいが、今みたいな展開時は「騙し上げ→下がる→騙し上げ→下がる」で結局ジリ貧のケースが経験上多い。従って、米国株も仮想通貨も私は今は様子見をしている。', '2021-02-27 12:39:18', NULL, '2021-03-01 01:03:38', '2021-03-01 01:03:38', NULL);
